import React from 'react'
import {Container, Row, Col} from 'react-bootstrap';
import './Home.css';

function Home() {
  return (
    <div className='main'>
        <Container>
            <Row>
                <Col>
                Carta
                </Col>
                <Col>
                nose
                </Col>
            </Row>
        </Container>   
    </div>
  )
}

export default Home
